import React from 'react'
import {Routes,Route, Navigate} from 'react-router-dom';
import { useSelector } from 'react-redux';
import Login from './components/Login/Login';
import Register from './components/Register/Register';
const App = () => {
  const isAuth = Boolean( useSelector((state)=>{return state.token}));
  return (
    <Routes>
        <Route path='/chats' element={ isAuth?<Chats/>:<Navigate to="/login"/>}/>
        <Route path='/login' element={ !isAuth?<Login/>:<Chats/>}/>
        <Route path='/register' element={!isAuth?<Register/>:<Chats/>}/>
    </Routes> 
  )
}
export default App
